import "./App.css";
import Table from "./components/Table";
import SearchBar from "./components/SearchBar";

function App() {
  return (
    <div className="container p-5">
      <header >
        <h1>FlatironBankApp</h1>
      </header>
      <SearchBar/>
    <Table/>
    </div>
  );
}

export default App;
